Terminata la seconda maratona della mia vita, migliorato il tempo finale di parecchi muniti, sofferta tantissimo, non lo nascondo, ma dentro di me ho saputo tirar fuori un diavolo che non ha mollato mai, anche quando testa e gambe non ne avevano pi√π, dopo tanta sofferenza sono riuscito ad arrivare all'arrivo col sorriso a braccia aperte, e la foto parla da sola.
Vedere la torre di Pisa da lontano ti da una forza micidiale.
Devo ringraziare tantissima gente, dai miei genitori che hanno allestito veri e propri punti ristoro sparsi per il tragitto, a mio fratello che questa volta c'era per vedermi, a lei, la mia ragazza che gli ultimi 3km non vedevo l'ora di svenire sulle sue braccia all'arrivo, alla gente che nemmeno conosco che urlava il mio nome e al compagno di questo immenso viaggio e il suo coach, che senza di loro, sicuramente non sarebbe finita cos√¨..
Gli abbracci all'arrivo, dopo una maratona vanno oltre il volersi bene, oltre l'amicizia, oltre la stima... non hanno bisogno di spiegazioni ne di parole. 
Ora un po' di meritato riposo
